export function Copyright() {
    return (
      <Typography variant="body2" color="textSecondary" align="center">
        <a href="https://www.soyhenry.com">Henry!</a>
      </Typography>
    );
  } 

  //LOS ESTILOS DEL FORMULARIO SETEADOS
  const useStyles = makeStyles((theme) => ({
    paper: {
      marginTop: theme.spacing(8),
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
    },
    avatar: {
      margin: theme.spacing(1),
      backgroundColor: theme.palette.secondary.main,
    },
    form: {
      width: '100%', // Fix IE 11 issue.
      marginTop: theme.spacing(1),
    },
    submit: {
      margin: theme.spacing(3, 0, 2),
    },
  }));


  //LOGIN PRINCIPAL DE LA PAGINA!
  export function Login(props) {

    const classes = useStyles();
    const [input,setInput]=React.useState({
      email:'',
      password:''
    });

    //MANEJO DE ONCHANGE()
    const handleInputChange = function(e) {
      setInput({
        ...input,
        [e.target.name]:e.target.value
      })
    }

    const loginUser = function(e){
      e.preventDefault();
      Axios.post('http://localhost:3001/login',input,{withCredentials:true})
      .then(resp=>{
        props.setUser(resp)
      })
    }
    //COMPONENTE DE MATERIAL UI
    return (
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <div className={classes.paper}>
          <Avatar className={classes.avatar}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Ingresar
          </Typography>
          <form className={classes.form} noValidate>
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email"
              name="username"
              autoComplete="email"
              autoFocus
              onChange={(e) => handleInputChange(e)}
            />
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              name="password"
              label="Contraseña"
              type="password"
              id="password"
              autoComplete="current-password"
              onChange={(e)=>handleInputChange(e)}
            />
            <FormControlLabel
              control={<Checkbox value="remember" color="primary" />}
              label="Remember me"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              color="primary"
              className={classes.submit}
              onClick={(e)=>loginUser(e)}
            >
              Sign In
            </Button>
            <Grid container>
              <Grid item xs>
                <Link to="/forgotPassword" variant="body2">
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                <Link to = "/register">
                  <span>
                  "Don't have an account? Sign Up"

                  </span>
                </Link>
              </Grid>
            </Grid>
          </form>
        </div>
        <Box mt={8}>
          <Copyright />
        </Box>
      </Container>
    );
  }

  const mapStateToProps = state => {		
    return {		
      user: state.user,
    }		
  }

  const mapDispatchToProps = dispatch => {
    return {
      setUser: (resp)=>dispatch(setUser(resp)),
    }
  }

  export default connect(mapStateToProps, mapDispatchToProps)(Login);
